import React from "react";
function ContactCard()
{
    return(
        <div className="contacts">
        <div className="Contact-card">
            <img src="app\src\Image\dog1.jpg"/>
            <h3>Kishan P</h3>
            <p>Phone : 131331</p>
            <p>Email: kihan@gmail.com</p>
        </div>
  </div>
    )
}
export default ContactCard;
